import { useState } from "react";
import {Link,useNavigate} from 'react-router-dom';
import axios from 'axios';

function Login() {
let [username,setUSername]=useState("");
let [password,setPassword]=useState("");

const [values, setValues] = useState({
    email: "",
    password: "",
  });


let navigate = useNavigate();
let signIn=async (event)=> {
    event.preventDefault();
    let values = {"username":username,"password":password};
    try{
    let result = await axios.post("http://localhost:8081/user/signin",values);
    //console.log(result.data);
    if(result.data=="Admin Success"){
        navigate("/Admin");
    }else if(result.data=="Customer success"){
        navigate("/Customer");
    }else {
        alert(result.data);
    }
    }catch(ex){
        console.log(ex);
    }
}
    return(
        <div>
        <div>Login Page</div>
        <form onSubmit={signIn}>
        <label>Email</label>
        {/* <input type="username" name="username" onChange={e=>setUSername(e.target.value)}/><br/> */}
        <input
                  type="email"
                  onChange={(event) => {
                    setValues((prev) => ({ ...prev, email: event.target.value }));
                  }}
                  className="form-control"
                  id="exampleInputEmail1"
                  aria-describedby="emailHelp"
                  placeholder="Email Address"
                />
        <label>Password</label>
        {/* <input type="password" name="password" onChange={e=>setPassword(e.target.value)}/><br/> */}
        <input
                  onChange={(event) => {
                    setValues((prev) => ({ ...prev, password: event.target.value }));
                  }}
                  type="password"
                  className="form-control"
                  id="exampleInputPassword1"
                  placeholder="Password"
                />
        <input type="submit" value="submit"/>
        <input type="reset" value="reset"/><br/>
        <Link to="signup">SignUp</Link>
        </form>
        </div>
    )
}

export default Login;
